import React from 'react'

function Inpo() {
  return (
    <div className='about_inpo grid'>
        <div className='about_box'>
            <h3 className='about_title'></h3>
            <span className='about_subtitle'></span>
        </div> 
    </div>
  )
}

export default Inpo
